import { Task } from "./module/task";
alert(1);

const state = [
  new Task(1, "task 1"),
  new Task(2, "task 2"),
  new Task(3, "task 3"),
];

const TodoReducer = (typeAction, inputAction) => {
  switch (typeAction) {
    case "todo/add":
      return [...state, new Task(state.length + 1, inputAction.titleTask)];

    default:
      return state;
  }
};

let newState = TodoReducer("todo/add", { titleTask: "task:4" });
console.log(newState);
